import React, { Component } from 'react';
import './colleges.css';
import Data from '../Data.json';
import Image from '../Images/college.jpg';

export default class Colleges extends Component {
	render() {
		let Colleges = Data.colleges;
		console.log(Colleges, 'check the list of data');

		return (
			<>
				<div className='container'>
					<div className='grid-col-2'>
						{Colleges.map((value) => {
							return (
								<div className='hero_section '>
									<div className='row-1-col-1'>
										<div className='college-image background_image'>
											<div className='rating'></div>
											<div className='overlay'>
												<div className='flex'>
													<div className='rectangle-2 Best-college'>
														{value.tags[0]}
													</div>
													<div className='rectangle-2 Best-college'>
														{value.tags[1]}
													</div>
												</div>
											</div>
										</div>
									</div>
								</div>
							);
						})}
					</div>
				</div>
			</>
		);
	}
}
